<div class="pop-full-screen-by-sell pop-full-screen_position d-none">
  <div class="fixed-top">
    <div class="pop-full-screen-close-by-sell pop-full-screen-close_position"><i class="fas fa-times"></i></div>
    <div class="pop-table pop-table_position">
      <h2 class="pop-table-title">Купить/продать</h2>
      <div class="pop-table-title__div">
        <p class="pop-table__p" >Ваше имя:</p>
        <input class="pop-table__input" type="text" name="name" id="buy_name" value="" placeholder="Ваше имя:">
      </div>
      <div class="pop-table-title__div">
        <p class="pop-table__p">Ваш номер телефона:</p>
        <input class="pop-table__input mask" type="tel" name="tel" id="buy_phone" value="" placeholder="+7 977 194-73-51">
      </div>
      <div class="pop-table-title__div">
        <p class="pop-table__p">Ваш e-mail:</p>
        <input class="pop-table__input" type="email" name="email" id="buy_email" value="" placeholder="Ваш e-mail:">
      </div>
      <div class="pop-table-div-textarea"><textarea class="pop-table-div__textarea" name="text" id="buy_text" placeholder="Хочу купить/продать"></textarea></div>
       <p class="pop-table-enter__p text-center"  id="formBuyOrder" style="color: red;"></p>
      <div class="pop-table-div-button"><button class="pop-table-div__button-custom" onclick="sendOrderBuy()">Отправить</button></div>
    </div>
  </div>
</div>
<!-- Купить - продать Конец-->
